import "../styles/Navbar.scss";
import { RiNetflixFill } from "react-icons/ri";
const Navbar = () => {
  return (
    <div>
      <div className='Navbar'>
        <div className='icon'>
          <RiNetflixFill />
        </div>
      </div>
    </div>
  );
};

export default Navbar;
